import React from 'react';
import axios from 'axios';



export default class BoxesList extends React.Component {

    state = {
        boxes: []
    };

    componentDidMount() {
        axios.get("https://jsonplaceholder.typicode.com/users").then(res => {
            this.setState({boxes: res.data})
        });
    }


}
